// React
import React, { Fragment } from "react";

// Third pard
import { Row, Col, Form, Input, Button, Typography, Card } from "antd";
import { Link } from "react-router-dom";

// custom
import Image from "./image";
import { openNotification } from "../custom/";

// services
import { login } from "../../services/userServices";
const layout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 24 }
};

const SignIn = ({ history }) => {
  const onhandleAdd = async values => {
    try {
      await login(values, history);
    } catch (error) {
      console.log("Error");
    }
  };

  const onFinishFailed = errorInfo => {
    return openNotification(
      "error",
      "Email or Password is InCorrect",
      "Please retype Email or Password "
    );
  };

  return (
    <Fragment>
      <div className="border border-warning">
        <Row>
          <Col xs={12}>
            <Image />
          </Col>
          <Col xs={{ span: 12 }} xl={{ span: 10 }}>
            <Card bordered={false}>
              <Form
                {...layout}
                className=" mt-5 border border-danger"
                hideRequiredMark
                onFinish={onhandleAdd}
                onFinishFailed={onFinishFailed}
              >
                <Form.Item>
                  <Typography.Title className="text-center">
                    SignIn
                  </Typography.Title>
                </Form.Item>
                <Form.Item
                  label="Email"
                  name="email"
                  rules={[
                    {
                      required: true,
                      type: "email",
                      message: "Please input your Email!"
                    }
                  ]}
                >
                  <Input />
                </Form.Item>

                <Form.Item
                  label="Password"
                  name="password"
                  rules={[
                    {
                      required: true,
                      message: "Please input your password!"
                    }
                  ]}
                >
                  <Input.Password />
                </Form.Item>

                <Form.Item>
                  <Button type="primary" htmlType="submit">
                    Submit
                  </Button>
                  <p className="mt-3 ml-5">
                    <Link to="/register">or Register</Link>
                  </p>
                </Form.Item>
              </Form>
            </Card>
          </Col>
        </Row>
      </div>
    </Fragment>
  );
};

export default SignIn;
